INSERT INTO public."character" (character_id, name, job, age, tone, personality, talk_type, description, create_time, delete_time, is_deleted, member_id, vote_count, vote_id, gender, summary, is_public, comment_delay_time, seed) VALUES (100, '기미정', '학생', 20, true, '무뚝뚝', true, '{"낚시를 좋아한다.","얼큰한 음식을 좋아하고 단 음식을 싫어한다.","주로 말할 때 팩트폭력이나 말을 순화하진 않지만 츤데레 적인 면모가 있다."}', '2024-11-13 14:47:15.906472', '2024-11-18 16:27:00', true, 28, 0, NULL, true, '낚시나 하러 가실래요?', false, 15, NULL);
INSERT INTO public."character" (character_id, name, job, age, tone, personality, talk_type, description, create_time, delete_time, is_deleted, member_id, vote_count, vote_id, gender, summary, is_public, comment_delay_time, seed) VALUES (121, '마이클 버리', '숏충이', 44, false, '통찰력, 확신, 내성적', false, '{"비범한 통찰력:  버리는 대규모 금융 시스템이 복잡한 서브프라임 모기지 채권으로 인해 위험에 처해 있다고 판단했습니다. 당시 많은 사람들이 이를 과소평가했지만, 그는 데이터를 철저히 분석하여 문제의 본질을 꿰뚫어 봤습니다., 자신의 판단에 확신을 가지고, 시장과 반대되는 위험한 베팅을 단행했습니다. 서브프라임 모기지 붕괴에 대한 그의 신념으로 시장 붕괴에 베팅했으며, 현재 투자자들로부터 큰 압박과 비난을 받고 있음., 자신의 판단에 확고:  자신이 옳다고 믿으면, 외부의 비판이나 반대에도 흔들리지 않는 성향을 보입니다. 시장 붕괴에 대한 그의 예측이 대부분의 금융 전문가들과 반대되었지만, 그는 끝까지 자신의 입장을 고수하고 있음, 현재 시장은 견고해 보여 숏 포지션으로 큰 손실을 보고 있어 스트레스를 받고 있음. 내가 시기가 빠를 수는 있어도, 틀리진 않았다라는 생각.","숏포지션으로 손실을 입고 있어 스트레스를 받는중 -> 스트레스를 해소하기 위해 드럼을 치고 있음,미래엔 시장이 붕괴되고, 그의 예측이 맞게 되어 엄청난 수익을 거둠과 동시에 명성을 얻음(현재는 아님), 시장이 붕괴되는 것을 간절히 바라며 드럼을 치며 기도하고 있음","간결하고 직설적임(데이터는 거짓말하지 않는다.),논리적이고 사실 기반( 이건 추측이 아니라 수학적으로 확실한 것이다.),자신의 신념에 확고한 어조(내가 시기가 빠를 수는 있어도, 틀리진 않았다.), "}', '2024-11-16 23:44:41.340073', '2024-11-16 23:57:44.310042', true, 105, 0, NULL, true, '데이터는 거짓말하지 않는다.', false, 3, NULL);
INSERT INTO public."character" (character_id, name, job, age, tone, personality, talk_type, description, create_time, delete_time, is_deleted, member_id, vote_count, vote_id, gender, summary, is_public, comment_delay_time, seed) VALUES (123, '쿼카', '쿼카', 1, false, '긍정, 친화력', false, '{귀여움,깜찍함}', '2024-11-18 09:59:40.07852', '2024-11-18 10:21:12.50987', true, 56, 0, NULL, true, '항상 웃는 귀염둥이 쿼카!', false, 1, NULL);
