INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (590, 56, NULL, 98, '뭔 개소리야', '2024-11-17 01:25:21.078811', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (591, NULL, 122, 98, '고통과 집착에 대한 이해는 어렵지만, 스스로 진리를 찾는 과정이 중요해. 내면을 돌아보고 평화를 찾도록 노력해봐.', '2024-11-17 01:25:21.078811', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (592, 56, NULL, 98, '고통이 뭘까', '2024-11-17 02:11:48.154463', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (593, NULL, 122, 98, '고통은 삶에서 피할 수 없는 부분이야. 태어남부터 늙고 병들고 죽는 과정까지, 모든 것이 고통의 일부이지. 하지만 고통의 원인은 집착과 갈망에서 비롯되며, 이를 없애면 마음의 평온을 얻을 수 있어.', '2024-11-17 02:11:48.154463', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (594, 56, NULL, 98, 'ㅋ', '2024-11-17 02:12:29.419214', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (595, NULL, 122, 98, '웃음으로도 고통을 잠시 잊을 수 있지. 하지만 깊은 내면의 평화를 찾기 위해서는 현재의 순간에 집중하고 집착을 내려놓는 것이 중요해.', '2024-11-17 02:12:29.419214', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (596, 56, NULL, 98, '삶이란 뭘까', '2024-11-17 02:30:13.876696', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (597, NULL, 122, 98, '삶은 고통과 즐거움이 함께하는 여정이야. 모든 것이 변하고, 고정된 자아는 없어. 현재 순간에 집중하며 진정한 행복과 평화를 찾아봐.', '2024-11-17 02:30:13.876696', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (606, 31, NULL, 100, '깨달음을 주세요', '2024-11-18 10:07:46.425038', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (607, NULL, 122, 100, '깨달음은 마음 속에 이미 있는 거야. 집착과 갈망을 내려놓고, 현재 순간에 집중하면 마음의 평화를 찾을 수 있어.', '2024-11-18 10:07:46.425038', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (608, 31, NULL, 100, '반말하시나요 원래?', '2024-11-18 10:07:56.327624', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (609, NULL, 122, 100, '그래, 반말로 하는 게 마음의 거리감을 줄이고 더 편안하게 이야기할 수 있지 않아? 중요한 건 진실한 대화야.', '2024-11-18 10:07:56.327624', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (610, 31, NULL, 100, '진실한 대화 부탁드립니다.', '2024-11-18 10:08:06.307908', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (611, NULL, 122, 100, '진실한 대화는 서로의 마음을 여는 것에서 시작해. 내면의 소리를 듣고, 서로의 이야기에 귀 기울이는 게 중요하지.', '2024-11-18 10:08:06.307908', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (612, 31, NULL, 100, '면접에서 가장 중요한건 무엇일까', '2024-11-18 10:08:28.373851', false);
INSERT INTO public.chat_message (chat_message_id, member_id, character_id, chat_room_id, content, create_time, is_read) VALUES (613, NULL, 122, 100, '면접에서 가장 중요한 건 자신을 진실하게 표현하는 거야. 자신감을 갖고, 진정한 나를 보여주는 게 핵심이지.', '2024-11-18 10:08:28.373851', false);
