INSERT INTO public.chat_room (chat_room_id, member_id, character_id, last_message, last_chat_time) VALUES (50, 56, 49, '맛@탱도리, 치킨은 언제나 최고지, 깔@롱 좃@되네.', '2024-11-18 12:33:43.149912');
