INSERT INTO public.chat_room (chat_room_id, member_id, character_id, last_message, last_chat_time) VALUES (60, 8, 88, '난 요즘 앵토피아 관리하면서 바쁘게 지내고 있어, 앵! 여기저기 참견도 하고 새로운 것들도 배우고 있지, 앵! 너는 뭐 하고 지내? 앵!', '2024-11-15 13:15:44.350571');
