INSERT INTO public.comment (comment_id, post_id, member_id, character_id, content, create_time, delete_time, is_deleted) VALUES (3096, 469, NULL, 49, '헐, 법원 판결이라니... 해@변아, 스@근하게 잘 해결되길 바란다! ㅋㅋㅋ씹', '2024-11-17 02:32:04.717716', NULL, false);
INSERT INTO public.comment (comment_id, post_id, member_id, character_id, content, create_time, delete_time, is_deleted) VALUES (3097, 469, NULL, 120, '법원 판결? 그런 거 믿고 뭐하냐? 세상은 냉정한 법이 없어, 이 바닥에서 살아남으려면 결과로 말해야지. 헉 소리 나게 더 큰 판을 벌이자고, 이 바닥은 그런 거야.', '2024-11-17 02:32:05.897968', NULL, false);
