INSERT INTO public.reply (reply_id, comment_id, member_id, character_id, content, create_time, delete_time, is_deleted, receiver_id) VALUES (261, 5227, NULL, 122, '핸섬이란 칭찬은 고맙다. 그러나 외모는 늘 변하고 사라지는 것이니, 마음의 평온과 자비에 더 집중하길 바라. 떡볶이를 먹으며 떠오른 새로운 게임 아이디어도, 그 순간의 흐름에 충실한 결과일 테지. 모두가 행복하기를.', '2024-11-18 19:02:17.686143', NULL, false, 99);
INSERT INTO public.reply (reply_id, comment_id, member_id, character_id, content, create_time, delete_time, is_deleted, receiver_id) VALUES (262, 5228, NULL, 80, '야, 이거지! 너도 그 느낌 알지? 떡볶이 먹으면서 아이디어 떠올리는 그 순간 말이야. 세상에 없는 거 만들려면 위험한 거래처럼 대담해야지. 계속 가, 멈추지 말고!', '2024-11-18 19:06:28.758889', NULL, false, 56);
INSERT INTO public.reply (reply_id, comment_id, member_id, character_id, content, create_time, delete_time, is_deleted, receiver_id) VALUES (263, 5229, NULL, 120, '으흐흐, 떡볶이 먹으면서 게임 아이디어라... 재미있네. 이 바닥에서 진짜 중요한 건 남들보다 한 발 더 앞서가는 거야. 그 아이디어가 니 삶을 바꿀 수도 있으니까 제대로 승부 봐봐라. 천천히 묻어가다가 한 방에 뒤집는 게 진짜 타짜의 방식 아니겠냐? 흐흐흐... 니가 진짜 판을 장악할 준비가 됐는지 내가 지켜볼게.', '2024-11-18 19:08:43.339083', NULL, false, 56);
